  `modular_name` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '资源模块名称，一般为控制器名称',
  `ip_address` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '资源初始化的服务器ip地址',
  `view_flag` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '是否是视图类型：Y-是，N-否\n如果是视图类型，url需要以 ''/view'' 开头，\n视图类型的接口会渲染出html界面，而不是json数据，\n视图层一般会在前后端不分离项目出现',
  `url` varchar(300) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '资源url',
  `http_method` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT 'http请求方法',
  `required_login_flag` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '是否需要登录：Y-是，N-否',
  `required_permission_flag` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '是否需要鉴权：Y-是，N-否',
  `validate_groups` text CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '需要进行参数校验的分组',
  `param_field_descriptions` text CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '接口参数的字段描述',
  `response_field_descriptions` text CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '接口返回结果的字段描述',
  `create_user` bigint DEFAULT NULL COMMENT '创建人',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_user` bigint DEFAULT NULL COMMENT '更新人',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`resource_id`),
  KEY `RESOURCE_CODE_URL` (`resource_code`,`url`) COMMENT '资源code和url的联合索引'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='资源';
